import { PostListComponent } from './post/list/list.component';

const routes: Routes = [

  {
    path:'user-list',
    component:UserListComponent
  },
   {
    path:'post-list',
    component:PostListComponent
  },
];

export const AppRoutingModule = RouterModule.forRoot(routes);

